import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent {
  title = 'from';
}
<nav class="navbar">
  <ul class="nav-menu">
    <li class="nav-item" routerLink="/signup" routerLinkActive="active">Sign Up</li>
    <li class="nav-item" routerLink="/signin" routerLinkActive="active">Sign In</li>
  </ul>
</nav>
<router-outlet></router-outlet>
